Description:
1. JOB DESCRIPTION: 
- Analyse, design, develop applications; 
- Collect requirements, develop functional specification documents, design the system; 
- Coordinate with related departments to perform tasks. 
2. JOB REQUIREMENTS 
- Bachelor’s degree in computer science, computer engineering, or a similar field. 
- Previous experience working as a unity or Unity3D developer. 
- In-depth knowledge of unity and Unity3D software. 
- Knowledge of 3D development and integrated game physics. 
- Experience with console and mobile game development. 
- Good communication skills. 
- Experience with memory and space optimization. 
- Knowledge of scripting, animation, session management, and textures. 
- Good troubleshooting skills. 
- Excellent attention to detail. 
3. WHY YOU'LL LOVE WORKING HERE 
- Work environment: 
 + Friendly and open working environment, working with many international colleagues and partners; 
 + Flexible working hours and remote mode, comfortable clothes; 
 + Time: 08:30 - 18:00, Monday to Friday, Saturday and Sunday off. 
- Career development opportunities: 
 + Workshop to learn and share every month; 
 + Support at least 50% of the cost of studying and taking the specialized certification exam for the job; 
 + Annual honors: Tech challenge of the year / Project of the year / Member of the year, etc. 
- Salary & benefits: 
 + Competitive and attractive salary. Negotiate directly with the Leader; 
 + Personal laptop allowance/support; 
 + 13th month bonus, project bonus, etc…; 
 + Review work efficiency every 6 months; 
 + Enjoy social insurance, health insurance and unemployment insurance 
 + benefits according to current law; 
 + Participating in teambuilding activities, company trips, weekly festivals and special occasions.

1.Mô tả công việc: 
1.1.Thiết kế website Wordpress (Website có hỗ trợ thêm các tính năng booking online, bán gift cards, coupons), SEO Top 10 Google Search và Top 3 Google Map trong 60 ngày. 
1.2.Social Media Marketing 
1.2.1.Set up: Cài đặt Google My Business, Fanpage, Instagram 
1.2.2.Đăng tải hàng tuần các hình ảnh và thông tin lên 3 trang mạng xã hội Google My Business, Facebook, Instagram (Các hình ảnh sẽ được chỉnh sửa bắt mắt bằng việc tăng độ sáng , thêm logo, số điện thoại của tiệm và địa chỉ tiệm cho từng tấm hình.) 
1.2.3.Phát triển mạng xã hội: tăng lượng viewers cho Google My Business, tăng Like cho Fanpage, tăng Followers cho Instagram; 
1.2.4.Hỗ trợ cài đặt chạy quảng cáo trên mạng xã hội: chạy quảng cáo Google Ads, Facebook, Instagram (không bao gồm tiền chạy quảng cáo); 
1.2.5.Báo cáo hàng tuần: viết nội dung công việc đã làm tuần trước, nội dung công việc sẽ làm tuần sau, báo cáo kết quả công việc hàng tuần ( Google Insights, Facebook Insights, Instagram Insights ); 
2.Tiến độ công việc: 
2.1.Tuần 1: xây dựng cơ bản Website, Google My Business, Fanpage, Instagram; 
2.2.Tuần 2: hoàn thiện và bàn giao Website, Google My Business, Fanpage, Instagram; 
2.3.Tuần 3 - tuần 10 ( cuối tháng thứ hai): SEO Top 10 Google Search và Top 3 Google Map; Đăng tải hàng tuần các hình ảnh và thông tin lên 3 trang mạng xã hội Google My Business, Facebook, Instagram; Phát triển mạng xã hội: tăng lượng viewers cho Google My Business, tăng Like cho Fanpage, tăng Followers cho Instagram; Hỗ trợ cài đặt chạy quảng cáo trên mạng xã hội: chạy quảng cáo Google Ads, Facebook, Instagram; 
2.4.Tháng 3 - tháng 12: SEO hàng tuần, Social Media Marketing hàng tuần và báo cáo kết quả công việc hàng tuần ( Google Insights, Facebook Insights, Instagram Insights ); 
3.Đánh giá chất lượng công việc: đảm bảo tương tác tăng 5 % sau mỗi tuần (Website, Google My Business, Fanpage, Instagram); 
